H: </div><div class="t m0 xc h7 y29 ff1 fs2 fc0 sc0 ls1 ws2">WHEREAS, the OHA was established to better the conditions of native Hawaiians an<span class="_ _2"></span>d </div><div class="t m0 x1 h7 y2a ff2 fs2 fc0 sc0 ls1 ws2">Hawaiians as defined Hawaii Revised Statutes (HRS) sections <span class="ff1">10-2, 10-4(4), 10-4(6) and 10-</span></div><div class="t m0 x1 h7 y2b ff1 fs2 fc0 sc0 ls1 ws2">4(8), and other applicable law(s), as amended; and </div><div class="t m0 xc h7 y2c ff1 fs2 fc0 sc0 ls1 ws2">WHEREAS, the <span class="ff2">OHA is in need of services for </span>Standardization of Job Titles and </div><div class="t m0 x1 h7 y2d ff2 fs2 fc0 sc0 ls1 ws2">Description of Positions for the Office of Hawaiian Affairs<span class="ff1"> as described in this Contract and its </span></div><div class="t m0 x1 h7 y2e ff1 fs2 fc0 sc0 ls1 ws2">attachments; and </div><div class="t m0 xc h7 y2f ff1 fs2 fc0 sc0 ls1 ws2">WHEREAS, the OHA has awarded this Contract through competitive sealed proposals </div><div class="t m0 x1 h7 y30 ff1 fs2 fc0 sc0 ls1 ws2">submitted for RFP No. HR 2016-09 pursuant to Hawaii Revised Statues as amended a<span class="_ _2"></span>nd its </div><div class="t m0 x1 h7 y31 ff2 fs2 fc0 sc0 ls1 ws2">companion Hawaii Administrative Rules; and<span class="ff1"> </span></div><div class="t m0 xc h7 y32 ff1 fs2 fc0 sc0 ls1 ws2">WHEREAS, the CONTRACTOR has been evaluated as a responsible and  </div><div class="t m0 x1 h7 y33 ff1 fs2 fc0 sc0 ls1 ws2">responsive Offeror whose proposal is advantageous for OHA, such evaluation factors as </div><div class="t m0 x1 h7 y34 ff1 fs2 fc0 sc0 ls1 ws2">capacity, qualifications, and resources to perf<span class="_ _2"></span>orm the terms and<span class="fc2"> </span>conditions a<span class="_ _7"></span>greed to under this </div><div class="t m0 x1 h4 y35 ff1 fs2 fc0 sc0 ls1 ws3">Contract<span class="ff3 ws2">. </span></div><div class="t m0 xc h7 y36 ff1 fs2 fc0 sc0 ls1 ws2">NOW, THEREFORE, the parties hereto mutually