 shall be sent to the CONTRACTORs business and mailing a<span class="_ _2"></span>ddress as set forth </div><div class="t m0 x1 h7 y35 ff1 fs2 fc0 sc0 ls1 ws2">in the first paragraph of this Contract.  A notice shall be deemed to have been re<span class="_ _2"></span>ceived THREE </div><div class="t m0 x1 h7 y36 ff1 fs2 fc0 sc0 ls1 ws2">(3) days after mailing or at the time or actual receipt, whichever is earlier.  The CONTRACTOR </div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
